import React from "react";

const Sresult = (props) =>{
   const img = `https://source.unsplash.com/erondu/300*200/?${props.name}`;
    //const img = `https://image.unsplash.com/erondu/600*400/?apple`;
    return(
        <>
            <div>
                <img src= {img} alt="search"/>
            </div>
        </>
    )
}


export default Sresult
